(5,'','Dear $BILL-C_NAME$\n\nA Pre-Authorisation from your credit/debit-card has been secured in anticipation of the successful registration of the following domain name listed below. The value of the credit/debit-card Pre-Authorisation is $TRANSACTION_VALUE$ Euro.\n\nThis Credit/Debit Card Pre-Authorisation will charged to your card upon final acceptance of the domain name by our Registration Services staff, after which you will receive an invoice for this amount by PDF.\n\nIf your new registration application is unsuccessful, these Pre-Authorised funds will be released back to your card, upon cancellation of the application ticket.  An email will be sent to you to notify you in this instance.\n\nNew Registration: Application Details:\n\n$TRANSACTION_DETAIL$\n\nKind Regards\nAccounts Team\nIE Domain Registry Limited\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n--------------------------------------------------------------------------------------------------------------------------------------- \n\n\n\n\n','Pre-Auth From Credit/Debit Card- NReg pending - $ORDER_ID$ $DOMAIN$','$BILL-C_EMAIL$','receipts@iedr.ie','receipts@iedr.ie','receipts@iedr.ie','1','1'),
