(9,'','Dear $GAINING_BILL-C_NAME$\n\nA Pre-Authorisation from your credit/debit-card has been secured in anticipation of the successful transfer of the following domain name $DOMAIN$ to your account. The value of the credit/debit-card Pre-Authorisation is $TRANSACTION_VALUE$ Euro.\n\nThis Credit/Debit Card Pre-Authorisation will be reserved and settled upon final acceptance of the transfer by our Registration Services staff, after which you will receive an invoice for this amount by PDF.\n\nIf your transfer request is unsuccessful, these Pre-Authorised funds will be released back to your card, upon cancellation of the application ticket.  An email will be sent to you to notify you in this instance.\n\nTransfer Request: Ticket Details:\n\n$TRANSACTION_DETAIL$\n\nKind Regards\nAccounts Team\nIE Domain Registry Limited\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n---------------------------------------------------------------------------------------------------------------------------------------','Pre-Auth From Credit/Debit Card- Xfer pending - $ORDER_ID$ $DOMAIN$','$GAINING_BILL-C_EMAIL$','receipts@iedr.ie, registrations@iedr.ie','receipts@iedr.ie','receipts@iedr.ie','1','1'),
(10,'','Dear $GAINING_BILL-C_NAME$,\n\nA reservation from your deposit account has been accepted in respect of payment of the domain name $DOMAIN$ which has now been successfully transferred to your account. The value of the deposit reservation is $TRANSACTION_VALUE$ Euro.\n\nThis accepted deposit reservation will be settled at 11.00pm tonight, and a VAT invoice will be automatically issued to you by PDF.\n\n*The renewal date(s) below (*RenDt) do NOT reflect the reservation. Renewal dates will be updated upon settlement at 11.00pm tonight*\n\n$TRANSACTION_DETAIL$\n\n\nKind Regards\nAccounts Team\nIE Domain Registry Limited\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n--------------------------------------------------------------------------------------------------------------------------------------- ','Xfer Reservation From Deposit - $ORDER_ID$ $DOMAIN$','$GAINING_BILL-C_EMAIL$','receipts@iedr.ie','','receipts@iedr.ie','1','1'),
(11,'','\n** This is very important, please read it carefully **\n\nPlease do not reply directly to this email as this email address is not monitored.\n\nDear $ADMIN-C_NAME$\n\nAs Administrative Contact for the domain name $DOMAIN$ we would like to inform you that your domain name has now passed its renewal date $RENEWAL_DATE$, and has now entered into the IE Domain Registrys Non-Renewal Process (NRP).\n\nWhat does this mean for you?\nThis means that if your domain name is not renewed by $SUSPENSION_DATE$ it will be suspended at 12.00 mid-day on this date. If your domain name is suspended, you will no longer have access to your website or email which is attached to this address.\nThe domain name can still be renewed up to the point of its ultimate deletion on $DELETION_DATE$.\nOnce deleted the domain name will become available for re-registration to the general public on a first come, first served basis.\n\nPlease take note: This is the only notification that you will receive from IE Domain Registry. At the point the domain name is suspended on $SUSPENSION_DATE$, we will be unable to make further contact with you.\n\nWhat to do next:\nIf you wish to renew your domain name:\nPlease contact your billing agent $BILL-C_NAME$ on $BILL-C_TEL$, who is currently responsible for managing your domain name, and make the appropriate payment.\n\nIf you do not wish to renew your domain name:\nYou should take no further action, the domain name will ultimately be deleted on $DELETION_DATE$.\n\nWhy should you renew $DOMAIN$?\n - It is your Irish identity on the Internet - $DOMAIN$ shows you are located or doing business in Ireland.\n - Increased consumer confidence and credibility - All .ie holders must authenticate their claim to their domain name; hence we have visibility of who is behind a .ie domain name.   As a result online fraud is less likely to occur on a website using a .ie address.\n - Greatly improved listing in search engines - .ie addresses receives higher ratings in search engines, such as Google.ie, than Irish based .com addresses.\n - Security: the .ie namespace is consistently ranked among the top five safest in the world.\n\nKind Regards \n\nIE Domain Registry Limited\nWeb: www.iedr.ie\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n--------------------------------------------------------------------------------------------------------------------------------------- \n\n\n\n\n\n\n','Notification of Involuntary Non renewal of domain name: $DOMAIN$','$ADMIN-C_EMAIL$','$BILL-C_EMAIL$, $WEBMASTER$, $INFO$, $POSTMASTER$','nrp@iedr.ie, donotreply@iedr.ie','donotreply@iedr.ie','1','0'),
(12,'','\n**This is very important please read it carefully**\n\nDear $ADMIN-C_NAME$\n\nAs Administrative Contact for the domain name $DOMAIN$, we would like to inform you that the renewal date $RENEWAL_DATE$ has now passed and your domain name has entered into the IEDR Non-Renewal Process (NRP) for ultimate deletion on $DELETION_DATE$ due to non-payment.\n\nWhat does this mean for you?\nThis means that if your domain name is not removed from the IEDR Non-Renewal Process (NRP) by $SUSPENSION_DATE$ it will be suspended at 12.00 mid-day on this date.  If your domain name is suspended, you will no longer have access to your website or email which is attached to this address.  Ultimate deletion of your domain name will occur on $DELETION_DATE$, whereby your domain name will become available for re-registration to the general public on a first come, first served basis.\n\nPlease take note:  This is the only notification that you will receive from IE Domain Registry.  At the point the domain name is suspended on $SUSPENSION_DATE$, we will be unable to make further contact with you.\n\nWhat to do next:\nIf you wish to renew your domain name:\nLog onto your account at https://console.iedr.ie (enter your account details and password).  Under Account Management/Domain Status (NRP)/Current NRP Status, select the domain name and remove from NRP Process (if you require advise please contact our accounts team at accounts@iedr.ie / (01) 2365422 who will assist you).\n\nIf you do not wish to renew your domain name:\nYou should take no further action; the domain name will ultimately be deleted on $DELETION_DATE$.\n\n\nWhy should you renew $DOMAIN$?\n - It is your Irish identity on the Internet - $DOMAIN$ shows you are located or doing business in Ireland.\n - Increased consumer confidence and credibility - All .ie holders must authenticate their claim to their domain name; hence we have visibility of who is behind a .ie domain name. As a result online fraud is less likely to occur on a website using a .ie address.\n - Greatly improved listing in search engines - .ie addresses receives higher ratings in search engines, such as Google.ie, than Irish based .com addresses.\n - Security: the .ie namespace is consistently ranked among the top five safest in the world.\n\nKind Regards\nIE Domain Registry Limited\n\nWeb: www.iedr.ie\n-------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n-------------------------------------------------------------------------------------------------------------------------------------\n\n\n\n\n\n\n','Notification of Involuntary Non renewal of domain name: $DOMAIN$','$ADMIN-C_EMAIL$','$BILL-C_EMAIL$, $POSTMASTER$, $WEBMASTER$, $INFO$, nrp@iedr.ie','nrp@iedr.ie','nrp@iedr.ie','1','0'),
(13,'','* This is very important, please read it carefully **\n\nPlease do not reply directly to this email as this email address is not monitored.\n\nDear $ADMIN-C_NAME$,\n\nAs Administrative Contact for the domain name $DOMAIN$, we would like to inform you that your domain name has been entered into IEDR Non-Renewal Process (NRP), as requested by $BILL-C_NAME$.\n\nIf you wish to keep $DOMAIN$:\nPlease immediately contact $BILL-C_NAME$, $BILL-C_TEL$ who are currently responsible for managing your domain name.\n\nIf you do not wish to keep $DOMAIN$:\nYou should take no further action.  Suspension of the domain name will occur in 14 days time, resulting in you no longer having access to your website or e-mail services. 14 days following suspension the domain name will be ultimately deleted from the .ie database, at which point it will become available to the general public for re-registration on a first come, first served basis.\n\nWhy should you renew $DOMAIN$?\nIt is your Irish identity on the Internet - $DOMAIN$ shows you are located or doing business in Ireland.\nIncreased consumer confidence and credibility: All .ie holders must authenticate their claim to their domain name; hence we have visibility of who is behind a .ie domain name.   As a result online fraud is less likely to occur on a website using a .ie address.\nGreatly improved listing in search engines - .ie addresses receives higher ratings in search engines, such as Google.ie, than Irish based .com addresses.\nSecurity: the .ie namespace is consistently ranked among the top five safest in the world.\n\n\nKind Regards \n\nIE Domain Registry Limited\nWeb: <www.iedr.ie/billing-agent>\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n--------------------------------------------------------------------------------------------------------------------------------------- ','Notification of Voluntary Non renewal of domain name: $DOMAIN$','$ADMIN-C_EMAIL$','$BILL-C_EMAIL$, $POSTMASTER$, $WEBMASTER$, $INFO$, nrp@iedr.ie','donotreply@iedr.ie','donotreply@iedr.ie','1','0'),
(14,'','\n* * This is very important, please read it carefully **\n\nDear $ADMIN-C_NAME$\n\nAs Administrative Contact for the domain name $DOMAIN$, we would like to inform you that the domain name has entered into the IEDR Non Renewal Process at your request.\n\nWhat does this mean for you?\nThis means that if your domain name is not removed from the IEDR Non-Renewal Process (NRP) by $SUSPENSION_DATE$ it will be suspended at 12.00 mid-day on this date. If your domain name is suspended, you will no longer have access to your website or email which is attached to this address. Ultimate deletion of your domain name will occur on $DELETION_DATE$, whereby your domain name will become available for re-registration to the general public on a first come, first served basis.\n\nPlease take note: This is the only notification that you will receive from IE Domain Registry. At the point the domain name is suspended on $SUSPENSION_DATE$, we will be unable to make further contact with you.\n\nWhat to do next:\nIf you wish to renew your domain name:\nLog onto your account at https://console.iedr.ie (enter your account details and password). Under Account Management/Domain Status(NRP)/Current NRP Status, select the domain name and remove from NRP Process (if you require advise please contact our accounts team at accounts@iedr.ie / (01) 2365422 who will assist you).\n\nIf you do not wish to rewnew your domain name:\nYou should take no further action, the domain name will ultimately be deleted on $DELETION_DATE$.\n\nWhy should you renew $DOMAIN$?\n- It is your Irish identity on the Internet $DOMAIN$ shows you are located or doing business in Ireland.\n- Increased consumer confidence and credibility - All .ie holders must authenticate their claim to their domain name; hence we have visibility of who is behind an .ie domain name. AS a result online fraud is less likely to occur on a website using an .ie address.\n- Greatly improved listing in search engines-. ie addresses receive higher ratings in search engines, such as Google, than Irish based .com addresses.\n- Security: the .ie namespace is consistently ranked amount the top five safest in the world.\n\nKind Regards \n\nIE Domain Registry Limited\nWeb: www.iedr.ie\n\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n---------------------------------------------------------------------------------------------------------------------------------------\n\n\n\n\n','Notification of Voluntary Non renewal of domain name: $DOMAIN$ ','$ADMIN-C_EMAIL$','$BILL-C_EMAIL$, $POSTMASTER$, $WEBMASTER$, $INFO$','nrp@iedr.ie','nrp@iedr.ie','1','0'),
