(34,'','\nPLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\n\nDear $GAINING_BILL-C_NAME$ \n\nTo complete the application request received to transfer billing agent to $GAINING_REGISTRAR_NAME$ we require the following documentation:-\nSigned authorisation by AdminC on letterhead specifying  the domain name to be transferred\nIf the domain holder does not have letterhead, we will accept documentation that specifies the business / company / organisation name and address\n\nPlease Note:  If the AdminC is no longer responsible for the domain, we will accept a document which confirms this and which provides details for a new AdminC and is signed by the new AdminC.\n\nKind Regards\nRegistration Services Team\nIE Domain Registry Limited\nTel:  +353 (1) 2365400\nFax: +353 (1) 2300365\nWeb: www.iedr.ie\n\n---------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n---------------------------------------------------------------------------------------------------------------------------\n\n','Query-Billing Transfer Request Re: $DOMAIN$','$GAINING_BILL-C_EMAIL$','$ADMIN-C_EMAIL$, registrations@iedr.ie','hostmaster-archive@domainregistry.ie, registrations@iedr.ie','registrations@iedr.ie','1','0'),
