(36,'','\n\n\nPLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\n\nDear $GAINING_BILL-C_NAME$\n\nYour transfer request for the domain name $DOMAIN$ has been successful.  \n\nPlease note:  The nameserver information supplied with the transfer application will now be verified. If the name servers are not fully configured, a notification email will be sent to the email address of the technical contact.\n\n\nKind Regards\nRegistration Services Team\nIE Domain Registry Limited\nTel:  +353 (1) 2365400\nFax: +353 (1) 2300365\nWeb: www.iedr.ie\n\n\n---------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n---------------------------------------------------------------------------------------------------------------------------\n\n\n\n','Billing Transfer Accepted Re: $DOMAIN$','$GAINING_BILL-C_EMAIL$','$ADMIN-C_EMAIL$, registrations@iedr.ie','hostmaster-archive@domainregistry.ie, registrations@iedr.ie','registrations@iedr.ie','1','0'),
(37,'','\n\nPLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\n\n** This is Important ** Please read carefully **\n\nTo whom it concerns\n\n Your request to Transfer a domain on $TICKET_CREATION_DATE$ has been accepted.\n\nThe verification of nameservers was NOT successful for your request\nIf the configuration is not resolved, your request will lapse in $TICKET_DAYS_REMAINING$ days.\nThe administrator of the nameservers (your hosting provider or Registrar) must correct the problems in order for your domain to function on the new nameservers.\nThe IE Domain Registry Limited CANNOT rectify the problem as it lies with your\nnominated hosting provider.\n\nWe will recheck the nameservers provided and will complete the process once the settings have been found to be correct. Requests that are not completed within the remaining time will expire and will have to be resubmitted.\n\nThe nameserver errors are shown below. Please ensure the person responsible\nis notified. The nameservers being tested are as follows:\n\n$DNS1$ and $DNS2$\n\nFor any queries related to your domain name please contact your registrar, $REGISTRAR_NAME$\n\nKind Regards\nRegistration Services Team\nIE Domain Registry Limited\nTel:  +353 (1) 2365400\nFax: +353 (1) 2300365\nWeb: www.iedr.ie\n\n-------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n-------------------------------------------------------------------------------------------------------\n\n','Billing Transfer - Important Notice Re DNS Info Re: $DOMAIN$','$TECH-C_EMAIL$','registrations@iedr.ie, $GAINING_BILL-C_EMAIL$','hostmaster-archive@domainregistry.ie, registrations@iedr.ie','registrations@iedr.ie','1','0'),
