(49,'','\nPLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\n\nDear $NIC_NAME$,\n\nA Password Reset Token has been requested for your IEDR account. This token is required to reset your password. Please note that:\n\n- This token will expire after a 24 hour period. You must request another if not used within that timeframe\n- This token is only valid for one reset attempt. If it is used in an attempt to reset your password and the attempt fails for any reason (e.g., you enter an invalid new password) you must, for security reasons, request another token.\n- If you did not request a password reset token, please contact the IEDR, as there may be an unauthorised attempt to interfere with your account in progress.\n\nUsername: $NIC$\nPassword Reset Token: $PASSWORD_TOKEN$\n\nPlease click here to reset your password:\n\nhttps://console.iedr.ie/index.php?r=passwordReset/changePassword\n\nKind Regards\nRegistration Services Team\nIE Domain Registry Limited\nTel:  +353 (1) 2365400\nFax: +353 (1) 2300365\nWeb: www.iedr.ie\n\n\n-------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n-------------------------------------------------------------------------------------------------------\n\n\n\n\n\n','NIC Handle Password Reset $NIC$','$NIC_EMAIL$','','','','1','0'),
