(51,'','\nPLEASE DO NOT REPLY TO THIS EMAIL. THIS IS AN AUTOMATED EMAIL\n\nDear $NIC_NAME$,\n\nThank you for registering on the IEDR website.\n\nYour account has been created under the username $NIC$.\n\nYou can update your account details at any stage by logging into your account at https://console.iedr.ie\n\nKind Regards\nRegistration Services Team\nIE Domain Registry Limited\nTel:  +353 (1) 2365400\nFax: +353 (1) 2300365\nWeb: www.iedr.ie\n\n-------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n-------------------------------------------------------------------------------------------------------\n\n','NIC Handle Registration Notification $NIC$','$NIC_EMAIL$','registrations@iedr.ie','hostmaster-archive@domainregistry.ie, registrations@iedr.ie','registrations@iedr.ie','1','0'),
(55,'',' * * This is very important, please read it carefully **\nPlease do not reply directly to this email as this email address is not monitored.\n\nDear $ADMIN-C_NAME$\n\nAs Administrative Contact for the domain name $DOMAIN$, we would like to inform you that your domain name has been entered into IEDR Non-Renewal Process (NRP), as requested by your billing agent $BILL-C_NAME$.\n\nIf you wish to keep $DOMAIN$ \nPlease immediately contact $BILL-C_NAME$, $BILL-C_TEL$ who are currently responsible for managing your domain name.\n\nWhat does this mean for you?\nThis means that if your domain name is not removed from the IEDRa non-renewed process by $SUSPENSION_DATE$ it will be suspended at 12.00 mid-day on this date. If your domain name is suspended, you will no longer have access to your website or email which is attached to this address.\nUltimate deletion of your domain name will occur on $DELETION_DATE$, where by tour domain will become available for re registration re-registration to the general public on a first come, first served basis.\n\nPlease take note: This is the only notification that you will receive from IE Domain Registry. At the point the domain name is suspended on $SUSPENSION_DATE$, we will be unable to make further contact with you.\n\nWhat to do next:\nIf you wish to renew your domain name:\nPlease contact your billing agent $BILL-C_NAME$ on $BILL-C_TEL$, who is currently responsible for managing your domain name, and make the appropriate payment.\n\nIf you do not wish to renew your domain name:\nYou should take no further action, the domain name will ultimately be deleted on $DELETION_DATE$.\n\nWhy should you renew $DOMAIN$?\n- It is your Irish identity on the Internet $DOMAIN$ shows you are located or doing business in Ireland.\n- Increased consumer confidence and credibility - All .ie holders must authenticate their claim to their domain name; hence we have visibility of who is behind an .ie domain name. As a result online fraud is less likely to occur on a website using an .ie address.\n- Greatly improved listing in search engines- .ie addresses receives higher ratings in search engines, such as Google, than Irish based .com addresses.\n- Security: the .ie namespace is consistently ranked amount the top five safest in the world.\n\n\nKind Regards \n\nIE Domain Registry Limited\nWeb: <www.iedr.ie/billing-agent>\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n---------------------------------------------------------------------------------------------------------------------------------------\n\n\n\n','Notification of Voluntary Non renewal of domain name: $DOMAIN$','$ADMIN-C_EMAIL$','$BILL-C_EMAIL$, $POSTMASTER$, $WEBMASTER$, $INFO$','nrp@iedr.ie, donotreply@iedr.ie','donotreply@iedr.ie','1','0'),
