(74,'','Dear $BILL-C_NAME$,\n\nAccount Number $BILL-C_NIC$\n\nThe domain name $DOMAIN$ has now reached its required renewal date, and is due for payment today. Please note, once the renewal date has passed $DOMAIN$ will enter into the non renewal process, and you will receive a further notification at 12.00 mid-day tomorrow.\n\nTo renew the above domain:\nPlease log onto your console account at https://console.iedr.ie (you will require you account number (noted above) and password to access your account)), select the domain name for online payment.   If you require any assistance in accessing your account please do not hesitate to contact our accounting team directly (accounts@iedr.ie / 01 2365422).  Once payment has been received today for the domain name, an invoice will be generated and a PDF copy will be emailed to you.\n\nI do not wish to renew my domain name?\nIf you no longer require this domain name you need take no further action.  The domain name will be automatically forwarded to IEDR Non Renewal Process (NRP) tomorrow at noon.\n\n\n Why should you renew $DOMAIN$?\n - It is your Irish identity on the Internet - $DOMAIN$ shows you are located or doing business in Ireland.\n - Increased consumer confidence and credibility - All .ie holders must authenticate their claim to their domain name; hence we have visibility of who is behind a .ie domain name.   As a result online fraud is less likely to occur on a website using a .ie address.\n - Greatly improved listing in search engines - .ie addresses receives higher ratings in search engines, such as Google.ie, than Irish based .com addresses.\n - Security: the .ie namespace is consistently ranked among the top five safest in the world.\n\n\nKind Regards\nAccounts Team\nIE Domain Registry Limited\nTel: (01) 2365 422\nWeb: http://www.iedr.ie\n---------------------------------------------------------------------------------------------------------------------------------------\nRegistered Office: Harbour Square, Block 2, 4th Floor, Dun Laoghaire, Co. Dublin.\nRegistered in Ireland. No: 315315.\n--------------------------------------------------------------------------------------------------------------------------------------- \n\n','Domain Expired: $DOMAIN$ ($RENEWAL_DATE$) Due for Payment','$BILL-C_EMAIL$','accounts@iedr.ie','','accounts@iedr.ie','1','0'),
