(256750,'R','hot-s-pot.ie',NULL,'Karin Lachenmayer',NULL,00000180,NULL,'Natural Person','Discretionary Name','','AHF930-IEDR',NULL,NULL,NULL,'AAM546-IEDR',NULL,'FBH1-IEDR',NULL,'FBH1-IEDR','ns1.webhostingireland.ie',NULL,NULL,NULL,'ns2.webhostingireland.ie',NULL,NULL,NULL,'ns3.webhostingireland.ie',NULL,NULL,NULL,3,'2008-07-16',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-16 10:40:33','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n',NULL,NULL,'2008-07-16 00:14:35','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
(256754,'R','anewsfrontier.ie',NULL,'almira communication',NULL,00000267,NULL,'Body Corporate (Ltd,PLC,Company)','Corporate Name','','AHJ847-IEDR',NULL,NULL,NULL,'ADC527-IEDR',NULL,'ADA345-IEDR',NULL,'ADA345-IEDR','ns1.eurodns.com',NULL,NULL,NULL,'ns2.eurodns.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'2008-08-14',0,'0000-00-00','N',NULL,NULL,NULL,'2008-08-14 10:15:23','Thank you for your application. To proceed with registration, please submit a copy of certificate of incorporation or VAT number for the applicant.\r\n\r\nPlease also submit information showing the applicant\'s connection to Ireland. \r\n\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n- Copies of invoices (showing trade to or from Ireland).\r\n- High-quality brochures.\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n- Community Trade Mark (CTM)\r\n\r\nWe will also require information showing the applicant\'s claim on the proposed domain name.',NULL,NULL,'2008-07-16 07:45:01','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
