(256894,'R','timhweldon.ie',NULL,'Tim Weldon',NULL,00000114,NULL,'Natural Person','Personal Name','Tim H Weldon - As a professional garden designer and horticulturist I wish to register a \'.ie\' domain in my name as a key part of the extension of my brand online.  I have already successfully registered my business trading name recently (rootdevelopmentgardens.ie) but I also need to be identified personally and professionally as the expert in my field (no pun intended!) by my own name.','AHJ985-IEDR',NULL,NULL,NULL,'HH36-IEDR',NULL,'HA18-IEDR',NULL,'HA18-IEDR','ns2.hosting365.ie',NULL,NULL,NULL,'ns3.hosting365.ie',NULL,NULL,NULL,'ns1.hosting365.ie',NULL,NULL,NULL,3,'2008-07-17',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-17 09:57:26','Thank you for your application. To proceed with registration, under the personal name category we will require the applicant to submit a copy of one of the following documents:-\r\nIf you are based in the republic: \r\n- Irish passport \r\n- Irish driver\'s licence\r\n- Irish revenue / social welfare document showing PPS no. \r\n- Irish birth certificate \r\n- Irish marriage certificate \r\n- Irish utility bill (e.g.: NTL, Chorus, SKY / ESB, Airtricity / Bord Gais / Eircom / Vodafone, O2, Meteor, Three - bill pay phones only).\r\n\r\nIf you are based in Northern Ireland : \r\n- UK driver\'s licence with Northern Ireland address. \r\n- HM Revenue & Customs / Northern Ireland Social Security Agency document showing - National Insurance no. \r\n- Northern Ireland birth certificate \r\n- Northern Ireland marriage certificate\r\n- Northern Ireland utility bill (e.g.: NTL, Chorus, SKY, UTV Internet / NIE, Airtricity / British Gas / BT / Vodafone, O2, 3, T-Mobile, Orange, BT - bill pay phones only).\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.12]\r\n',NULL,NULL,'2008-07-16 18:06:37','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
