(257104,'R','americanpainthorses.ie',NULL,'Bernadette O\\\'donoghue',NULL,00000180,NULL,'Natural Person','Discretionary Name','','AHG281-IEDR',NULL,NULL,NULL,'AAM546-IEDR',NULL,'FBH1-IEDR',NULL,'FBH1-IEDR','ns1.hu-dns.com',NULL,NULL,NULL,'ns2.hu.dns.com',NULL,NULL,NULL,'ns3.webhostingireland.ie',NULL,NULL,NULL,3,'2008-07-18',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-18 09:41:28','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n',NULL,NULL,'2008-07-18 00:14:25','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
(257107,'R','jmchugh.ie',NULL,'Private',2,00000122,NULL,'Natural Person','Personal Name','','AHK184-IEDR',NULL,NULL,NULL,'RIH12-IEDR',NULL,'NTG1-IEDR',NULL,'NTG1-IEDR','ns1.novara.ie',NULL,NULL,NULL,'ns2.novara.ie',NULL,NULL,NULL,'ns3.novara.ie',NULL,NULL,NULL,3,'2008-07-18',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-18 09:38:19','Thank you for your application. To proceed with registration, under the personal name category we will require the applicant to submit a copy of one of the following documents:-\r\nIf you are based in the republic: \r\n- Irish passport \r\n- Irish driver\'s licence\r\n- Irish revenue / social welfare document showing PPS no. \r\n- Irish birth certificate \r\n- Irish marriage certificate \r\n- Irish utility bill (e.g.: NTL, Chorus, SKY / ESB, Airtricity / Bord Gais / Eircom / Vodafone, O2, Meteor, Three - bill pay phones only).\r\n\r\nIf you are based in Northern Ireland : \r\n- UK driver\'s licence with Northern Ireland address. \r\n- HM Revenue & Customs / Northern Ireland Social Security Agency document showing - National Insurance no. \r\n- Northern Ireland birth certificate \r\n- Northern Ireland marriage certificate\r\n- Northern Ireland utility bill (e.g.: NTL, Chorus, SKY, UTV Internet / NIE, Airtricity / British Gas / BT / Vodafone, O2, 3, T-Mobile, Orange, BT - bill pay phones only).\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.12]\r\n',NULL,NULL,'2008-07-18 08:55:59','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
