(257981,'R','thehickeyfamily.ie',NULL,'Kenneth Hickey',NULL,00000259,NULL,'Natural Person','Discretionary Name','Hi my name is Kenneth Hickey and I am part of an extended family scattered across the world. I would like this domain name to help unite our extended family','AHK984-IEDR',NULL,NULL,NULL,'ABG704-IEDR',NULL,'AAP368-IEDR',NULL,'AAP368-IEDR','ns3.dnsireland.com',NULL,NULL,NULL,'ns4.dnsireland.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'2008-07-28',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-28 10:30:46','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n',NULL,NULL,'2008-07-26 10:23:37','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
