(258242,'R','theweddingphotographer.ie',NULL,'Darren Carter',NULL,00000114,NULL,'Discretionary Applicant','Discretionary Name','I am setting up a photography business and am currently waiting for my registration of business name to be completed. I have been told by the CRO that this can take up to a month.\nThis delay will cause me to loose valuable time in the marketing of the address as I was starting a process/market campaign on 1st August. If I can\'t get this domain sooner than 1 month I will have to choose a different domain that won\'t have the same branding value that I believe I can achieve with this domain name.','AHL234-IEDR',NULL,NULL,NULL,'HH36-IEDR',NULL,'HA18-IEDR',NULL,'HA18-IEDR','ns1.hosting365.ie',NULL,NULL,NULL,'ns2.hosting365.ie',NULL,NULL,NULL,'ns3.hosting365.ie',NULL,NULL,NULL,3,'2008-07-29',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-29 17:22:53','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n',NULL,NULL,'2008-07-29 17:05:57','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
