(258730,'R','shipmywine.ie',NULL,'McArdle Software Ltd',NULL,00000122,NULL,'BODY CORPORATE (LTD,PLC,COMPANY)','DISCRETIONARY NAME','****  Previously Registered To : Brendan McArdle  ****  \r\nBusiness number is: 402712','AHL677-IEDR',NULL,'',NULL,'RIH12-IEDR',NULL,'NTG1-IEDR',NULL,'NTG1-IEDR','NS1.NOVARA.IE',NULL,'',NULL,'NS2.NOVARA.IE',NULL,'',NULL,'NS3.NOVARA.IE',NULL,'',NULL,3,'2008-08-05',0,'0000-00-00','N',NULL,'0000-00-00','0000-00-00','2008-08-05 12:21:56','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\n',NULL,NULL,'2008-08-05 09:36:25','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
