(259122,'R','adultireland.ie',NULL,'Copa Internet Services Limited',NULL,00000259,NULL,'Body Corporate (Ltd,PLC,Company)','Discretionary Name','CRO: 381378','AHM025-IEDR',NULL,NULL,NULL,'ABG704-IEDR',NULL,'AAP368-IEDR',NULL,'AAP368-IEDR','ns5.dnsireland.com',NULL,NULL,NULL,'ns6.dnsireland.com',NULL,NULL,NULL,'ns7.dnsireland.ie',NULL,NULL,NULL,3,'2008-08-07',0,'0000-00-00','N',NULL,NULL,NULL,'2008-08-07 15:36:54','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n',NULL,NULL,'2008-08-07 15:15:59','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
(259123,'R','drumcouracity.ie',NULL,'Colin Gallagher',NULL,00000101,NULL,'Sole Trader','Publication Name','','AHM026-IEDR',NULL,NULL,NULL,'TDI2-IEDR',NULL,'IDL2-IEDR',NULL,'IDL2-IEDR','ns1.irishdomains.com',NULL,NULL,NULL,'ns2.irishdomains.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'2008-08-07',0,'0000-00-00','N',NULL,NULL,NULL,'2008-08-07 15:37:28','Thank you for your application. To proceed with registration, please submit information showing that the applicant produces a publication matching the proposed domain name, as per the policies for the Publication Name category:\r\n\r\nhttps://www.iedr.ie/RegistrationPolicy.php#PublicationName\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.7]\r\n',NULL,NULL,'2008-08-07 15:18:44','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
(259124,'R','forbetterliving.ie',NULL,'Deceuninck NV',NULL,00000136,NULL,'Body Corporate (Ltd,PLC,Company)','Discretionary Name','Please note, the client registered domains below to promote their products in Europe\r\\\n\r\\\nforbetterliving.it\r\\\nforbetterliving.nl\r\\\nforbetterliving.co.uk\r\\\nforbetterliving.cz\r\\\nforbetterliving.fr\r\\\nforbetterliving.es\r\\\n','AGM543-IEDR',NULL,'',NULL,'AAY760-IEDR',NULL,'SL120-IEDR',NULL,'SL120-IEDR','dns1.idp365.net',NULL,'',NULL,'dns2.idp365.net',NULL,'',NULL,'dns3.idp365.net',NULL,'',NULL,3,'2008-08-07',0,'0000-00-00','N',NULL,NULL,NULL,'2008-08-07 15:39:19','Thank you for your application. To proceed with registration, please submit a copy of certificate of incorporation or VAT number for the applicant.\r\n\r\nPlease also submit information showing the applicant\'s connection to Ireland. \r\n\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n- Copies of invoices (showing trade to or from Ireland).\r\n- High-quality brochures.\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n- Community Trade Mark (CTM)\r\n\r\nIn Addition, we will also require a letter from the applicant outlinig their claim on the proposed domain name.',NULL,NULL,'2008-08-07 15:28:40','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
