(259251,'R','cement.ie',NULL,'Brabus Domains Ltd',NULL,00000267,NULL,'Body Corporate (Ltd,PLC,Company)','Corporate Name','','AHM118-IEDR',NULL,NULL,NULL,'ADC527-IEDR',NULL,'ADA345-IEDR',NULL,'ADA345-IEDR','ns1.eurodns.com',NULL,NULL,NULL,'ns2.eurodns.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'2008-08-08',0,'0000-00-00','N',NULL,NULL,NULL,'2008-08-08 12:04:00','Thank you for your application. To proceed with registration, please submit a copy of certificate of incorporation or VAT number for the applicant.\r\n\r\nPlease also submit information showing the applicant\'s connection to Ireland. \r\n\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n- Copies of invoices (showing trade to or from Ireland).\r\n- High-quality brochures.\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n- Community Trade Mark (CTM)\r\n\r\nIn Addition, please provide a letter from the applicant outlining their claim on the proposed domain name. ',NULL,NULL,'2008-08-08 11:12:17','N','N',NULL,NULL,NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
