(245307,'R','pizzaonline.ie',NULL,'Zahid Hussain',NULL,00000101,NULL,'Sole Trader','Discretionary Name','','AGZ082-IEDR',NULL,NULL,NULL,'TDI2-IEDR',NULL,'IDL2-IEDR',NULL,'IDL2-IEDR','ns.irishdomains.net',NULL,NULL,NULL,'ns2.irishdomains.net',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'0000-00-00',0,'0000-00-00','Y','ALICE-IEDR',NULL,NULL,'2008-04-18 10:13:17','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n','2008-04-18 10:13:17','ALICE-IEDR',NULL,NULL,'0000-00-00 00:00:00','N','N',0,'Y',NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
