(257685,'R','chriswilson.ie',NULL,'Chris Wilson',NULL,00000259,NULL,'Natural Person','Personal Name','will send fax','AHK695-IEDR',NULL,NULL,NULL,'ABG704-IEDR',NULL,'AAP368-IEDR',NULL,'AAP368-IEDR','ns3.dnsireland.com',NULL,NULL,NULL,'ns4.dnsireland.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'0000-00-00',0,'0000-00-00','Y','PAUL-IEDR',NULL,NULL,'2008-07-24 09:13:04','Thank you for the e-mail received. However credit card statements are not acceptable to support an application under the Personal Name Category. \r\n\r\nTo proceed with registration, under the personal name category we will require the applicant to submit a copy of one of the following documents:-\r\nIf you are based in the republic: \r\n- Irish passport \r\n- Irish driver\'s licence\r\n- Irish revenue / social welfare document showing PPS no. \r\n- Irish birth certificate \r\n- Irish marriage certificate \r\n- Irish utility bill (e.g.: NTL, Chorus, SKY / ESB, Airtricity / Bord Gais / Eircom / Vodafone, O2, Meteor, Three - bill pay phones only).\r\n\r\nIf you are based in Northern Ireland : \r\n- UK driver\'s licence with Northern Ireland address. \r\n- HM Revenue & Customs / Northern Ireland Social Security Agency document showing - National Insurance no. \r\n- Northern Ireland birth certificate \r\n- Northern Ireland marriage certificate\r\n- Northern Ireland utility bill (e.g.: NTL, Chorus, SKY, UTV Internet / NIE, Airtricity / British Gas / BT / Vodafone, O2, 3, T-Mobile, Orange, BT - bill pay phones only).\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.12]\r\n','2008-07-24 09:13:04','PAUL-IEDR',NULL,NULL,'0000-00-00 00:00:00','N','N',0,'Y',NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
