(259890,'M','klatt.ie',NULL,'Klatt Management Services Ltd.',NULL,00000259,NULL,'BODY CORPORATE (LTD,PLC,COMPANY)','REGISTERED BUSINESS NAME','','ABU012-IEDR',NULL,'',NULL,'ABG704-IEDR',NULL,'AAP368-IEDR',NULL,'ABU012-IEDR','NS1.KLATT.IE',NULL,'83.143.160.147',NULL,'NS0.XNAME.ORG',NULL,'',NULL,'NS1.XNAME.ORG',NULL,'',NULL,0,'2008-08-13',0,'2008-08-13','Y','LORIN-IEDR',NULL,NULL,'2008-08-14 09:48:10','In order to transfer the ownership of a domain we will require the following.\r\n\r\n1. A signed fax on headed paper from the current admin-c stating that he/she authorises the cancellation of the domain name for the purpose of having it reassigned to the new domain holder.\r\n\r\n2. Information from the future holder showing their claim on the proposed name as per our registration policies. Please refer to the Policy section at the following url:\r\n\r\nhttps://www.domainregistry.ie/QuickGuideToRegistrations.php\r\n\r\n3. The future holder should also provide contact details for the future admin-c, together with the information showing their claim on the proposed name.\r\n\r\nAll requirements should be submitted simultaneously to avoid the domain being cancelled without the future holder having submitted all of the necessary requirements for registration. \r\n\r\n\r\n\r\nTYPE: Form issue\r\nCODE: [2.3]\r\n','2008-08-14 09:48:10','LORIN-IEDR',NULL,NULL,'0000-00-00 00:00:00','N','N',0,'Y',NULL,NULL,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00'),
