INSERT INTO `TicketIndex` VALUES (359632);
INSERT INTO `TicketResponse` VALUES (3,'RBN / CRO required','Thank you for your application, to proceed with registration please submit the applicants company or registered business name number. \r\n\r\nFor information relating to Irish company or business numbers please refer to: www.cro.ie.\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.4]\r\n'),
(4,'No claim to domain','Thank you for your application. To proceed with registration please submit information showing the applicants claim on the proposed domain name.\r\n\r\nFor information explaining the requirements for showing your claim to your chosen domain name please refer to the following url:\r\n\r\nhttp://www.iedr.ie/QuickGuideToRegistrations.php\r\n\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.1]\r\n'),
(8,'Update Holder and Admin','Thank you for the fax received.  Please update the Domain Holder and Admin Contact details to reflect the applicant, not a third party, and we will proceed with registration.'),
(10,'Geographical Rule','Thank you for your application, however, the registration of this domain name to the current applicant would contravene the Geographical Rule.  Please see section 3.6 of our Naming Policy at the following URL:\r\n\r\nhttp://www.iedr.ie/NamingPolicy.php#validity\r\n\r\nTo confirm whether a domain name corresponds to an Irish geographical place name please refer to the following search facility:\r\n\r\nhttp://www.iedr.ie/Geographical.php\r\n\r\n\r\n\r\nTYPE: Restriction\r\nCODE: [3.1]\r\n'),
(11,'Discretionary UK','Thank you for your application.  Please submit....\r\n1. The applicant\'s UK Company Number \r\n2. Information showing a claim to the domain as per Discretionary Name Category \r\n3. Information showing the applicant\'s connection to Ireland as per Registration Policies.  For example - \r\nCopies of invoices (showing trade to or from Ireland), or\r\nHigh-quality brochures showing a significant intention to trade in Ireland. or\r\nA signed letter on headed paper from a bank manager, firm of chartered accountants, registered auditors, tax consultants or solicitors confirming the applicants trade with Ireland. \r\n'),
(13,'Trading Name - RBN required','Thank you for the information received, however as this name is representative of the applicant\'s trading name, a registered business name number will be required to proceed with registration.\r\n\r\nThis policy can be viewed at the following url:\r\n\r\nhttp://www.iedr.ie/RegistrationPolicy.php#RegBusName'),
(14,'Investment of time effort & resources','Thank you for the fax received.  To proceed with registration, please submit information showing that the applicant has invested significant time, effort, or resources in a project relating to the proposed domain name.\r\n\r\nExamples:\r\nScreen shots of the website they intend to use at the domain name\r\nURL for an existing website they use for the project\r\nCopy of Logo designs for the project\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.14]\r\n'),
(16,'Publication requirements','Thank you for your application. To proceed with registration, please submit information showing that the applicant produces a publication matching the proposed domain name, as per the policies for the Publication Name category:\r\n\r\nhttps://www.iedr.ie/RegistrationPolicy.php#PublicationName\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.7]\r\n'),
(17,'Surname Restricted under Personal Trading Name category','Thank you for your application, however under the Personal Trading Name category, applicants are restricted to registering the full name only. Therefore we will not be able to proceed with the registration of this domain name as it corresponds to the applicants surname only.'),
(20,'Unincorporated Assoc.','Thank you for your application. To proceed with registration we will require a letter from the applicant on the association\'s letterhead stating that they are an Unincorporated Association and require the domain name to reflect their organisation\'s name.\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.10]\r\n'),
(21,'Mods - Changing Domain Holder ','In order to transfer the ownership of a domain we will require the following.\r\n\r\n1. A signed fax on headed paper from the current admin-c stating that he/she authorises the cancellation of the domain name for the purpose of having it reassigned to the new domain holder.\r\n\r\n2. Information from the future holder showing their claim on the proposed name as per our registration policies. Please refer to the Policy section at the following url:\r\n\r\nhttps://www.domainregistry.ie/QuickGuideToRegistrations.php\r\n\r\n3. The future holder should also provide contact details for the future admin-c, together with the information showing their claim on the proposed name.\r\n\r\nAll requirements should be submitted simultaneously to avoid the domain being cancelled without the future holder having submitted all of the necessary requirements for registration. \r\n\r\n\r\n\r\nTYPE: Form issue\r\nCODE: [2.3]\r\n'),
(22,'Educational Institution','Thank you for your application. To proceed with registration please submit a signed letter on the Educational Institution\'s headed paper stating that they require the domain name to reflect their school name.\r\n\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.8]\r\n'),
(24,'Deletion / No Authorisation','Thank you for your deletion request. To proceed we will require authorisation from the current administrative contact for the domain. Please supply a signed fax on headed paper from the current administrative contact stating that they authorise the deletion to be made. Authorisation will only be accepted by fax to (+353 1) 2300 365.'),
(25,'Explicit/Immoral Text','Thank you for your application, however the application has been rejected as it contravenes section 3.4 of the IE Naming Policy: The\r\nproposed domain name must not be offensive or contrary to public policy or generally accepted principles of morality.\r\n\r\n\r\nThis policy can be viewed at the following url:\r\n\r\n\r\nhttp://www.domainregistry.ie/NamingPolicy.php\r\n\r\n\r\n\r\nTYPE: Restriction\r\nCODE: [3.2]\r\n'),
(26,'Trademark receipt','Thank you for the fax received.  To proceed, please submit copies of the applicant\'s trademark application receipt.'),
(27,'Corporate UK','Thank you for your application.  Please submit....\r\n1. The applicant\'s UK Company Number \r\n2. Information showing the applicant\'s connection to Ireland as per Registration Policies.  For example - \r\nCopies of invoices (showing trade to or from Ireland), or\r\nHigh-quality brochures showing a significant intention to trade in Ireland, or\r\nA signed letter on headed paper from a bank manager, firm of chartered accountants, registered auditors, tax consultants or solicitors confirming the applicants trade with Ireland. '),
(29,'Anywhere outside Ireland - Discretionary','Thank you for your application.  Please submit....\r\n1. A copy of the applicant\'s certificate of incorporation\r\n2. Information showing a claim to the domain as per Discretionary Name Category:\r\n \r\nhttp://www.iedr.ie/QuickGuideToRegistrations.php#Discretionary_Name\r\n\r\n3. Information showing the applicant\'s connection to Ireland as per Registration Policies.  For example:- \r\n- Copies of invoices (showing trade to or from Ireland), or\r\n- High-quality brochures showing a significant intention to trade in Ireland. or\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountants, registered auditors, tax consultants or solicitors confirming the applicants trade with Ireland. \r\n- Community Trademark number\r\n'),
(30,'Mods - third party email address','Please amend the admin contact email address to be reflective of the applicant or applicant organisation.  Third party email addresses are not permitted.'),
(32,'Mods - Unauth admin change/3rd Party','In order to proceed with your modification request, we require signed authorisation to proceed to change the admin contact.\r\n\r\nPlease note the admin contact must be a person from within the applicant organisation.\r\n\r\n\r\n\r\nTYPE: Form issue\r\nCODE: [2.4]\r\n'),
(33,'Personal Name','Thank you for your application. To proceed with registration, under the personal name category we will require the applicant to submit a copy of one of the following documents:-\r\nIf you are based in the republic: \r\n- Irish passport \r\n- Irish driver\'s licence\r\n- Irish revenue / social welfare document showing PPS no. \r\n- Irish birth certificate \r\n- Irish marriage certificate \r\n- o\r\n\r\nIf you are based in Northern Ireland : \r\n- UK driver\'s licence with Northern Ireland address. \r\n- HM Revenue & Customs / Northern Ireland Social Security Agency document showing - National Insurance no. \r\n- Northern Ireland birth certificate \r\n- Northern Ireland marriage certificate\r\n- Northern Ireland utility bill (e.g.: NTL, Chorus, SKY, UTV Internet / NIE, Airtricity / British Gas / BT / Vodafone, O2, 3, T-Mobile, Orange, BT - bill pay phones only).\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.12]\r\n'),
(35,'Fax Received - no claim to name','Thank you for the fax received. To proceed with registration please submit information showing the applicants claim on the proposed domain name.\r\n\r\nFor information explaining the requirements for showing your claim to your chosen domain name please refer to the following url:\r\n\r\nhttp://www.iedr.ie/QuickGuideToRegistrations.php\r\n'),
(36,'Trademark number required','Thank you for your application, to proceed with registration please submit the applicants registered trademark number or certificate.\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.5]\r\n'),
(37,'Information Received/Further Required','Thank you for the fax received.  However, the applicant has not shown sufficient claim to the proposed domain name.\r\n\r\nPlease submit further information supporting the application for this domain.'),
(38,'Connection to Irl & Claim to Name','Thank you for your application.  In order to proceed we will require the applicant to submit information showing their connection to Ireland. \r\n\r\nFor information on showing a real and substantive connection to Ireland please refer to the \'Important Note\' at the following url:\r\n\r\nhttp://www.domainregistry.ie/QuickGuideToRegistrations.php\r\n\r\nPlease also submit information showing the applicants claim on the proposed domain name.\r\n\r\nFor information explaining the requirements for showing your claim to your chosen domain name please refer to the following url:\r\n\r\nhttp://www.iedr.ie/QuickGuideToRegistrations.php \r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.3]\r\n'),
(39,'Personal trading name','Thank you for your application. To proceed with registration, under the personal trading name category we will require the applicant to submit a VAT number or a letter from a solicitor, accountant or bank manager confirming that they trade under their own name.\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.11]\r\n'),
(40,'Admin full name required','Thank you for your application. In order to proceed with registration, please include a full name in the admin contact details.\r\n\r\n\r\n\r\nTYPE: Form issue\r\nCODE: [2.2]\r\n'),
(41,'Explain domain name','Thank you for your application. To proceed with registration please provide an explanation as to what the domain name represents.'),
(42,'No connection to Ireland','Thank you for your application. To proceed with registration, we will require the applicant to submit information showing their connection to Ireland. \r\n\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n- Copies of invoices (showing trade to or from Ireland).\r\n- High-quality brochures.\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n- Community Trade Mark (CTM)\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.2]\r\n'),
(43,'Politician\'s name','Thank you for your application. To proceed with registration we will require a signed letter, on official letterhead, from the politician confirming their eligibility to register a domain name in this category.\r\n\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.9]\r\n'),
(44,'Brand Name Authorisation','Thank you for your application. In order to proceed we will require a letter from the manufacturer advising that they authorise the applicant to register their product name as a .ie domain name. We will proceed upon receipt of the same.'),
(46,'Dissolved Company','Thank you for your application. Unfortunately it appears that the applicant company currently has a dissolved status with the Irish companies office. We will not be able to proceed until the applicants company status has been reinstated with the CRO.'),
(48,'PDN (surname only) Restriction','Thank you for your application. Under the present policies of the IEDR, the registration of surnames only is not permitted. The first name or first initial must form part of the domain name. \r\nSee: www.pdn.ie for further details.\r\n\r\n\r\n\r\nTYPE: Restriction\r\nCODE: [3.3]\r\n'),
(50,'Can\'t verify RBN and no connection to Ireland','Thank you for your application, we could not verify the CRO/RBN number provided, therefore please submit a copy of the Company or Business certificate or a revised CRO/RBN number and we will proceed with registration.\r\n\r\nPlease also submit information showing their connection to Ireland. \r\n\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n- Copies of invoices (showing trade to or from Ireland).\r\n- High-quality brochures.\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n- Community Trade Mark (CTM)\r\n'),
(51,'Statutory Body','Thank you for your application. To proceed with registration please submit a self-issued letter on the applicant\'s letterhead explaining their claim to the proposed domain name.\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.6]\r\n'),
(52,'Payment Expired','This application has been cancelled as the original registration payment has expired due to the length of time since the application was submitted. To register this domain name you must resubmit the application and payment.'),
(53,'Discretionary Name','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n'),
(55,'Surname - RBN/CRO only','Thank you for the fax received.  However under the IEDR\'s policies the registration of surnames as domain names is restricted to the Company Name and Registered Business Name categories.'),
(57,'PDN - Wrong format','Thank you for your application. Unfortunately, the format of the proposed domain name is not permitted under the Personal Domain Name category, therefore we cannot proceed with registration. For information on the correct domain format permitted within this category, please refer to the following url:\r\n\r\nhttp://www.iedr.ie/PDN.php'),
(58,'PDN- Application made before policy relaxation','Thank you for your application. This application was initially made prior to 8am on October 31st when the Personal Domain Name policy was relaxed. Therefore, we cannot proceed with registration.'),
(60,'PDN - Bank Statement Response','Thank you for the fax received.  However bank statements are not acceptable documents to support a Personal Domain Name application.  Please submit a copy of one of the following documents:-\r\nIf you are based in the republic: \r\n- Irish passport \r\n- Irish driver\'s licence\r\n- Irish revenue / social welfare document showing PPS no. \r\n- Irish birth certificate \r\n- Irish marriage certificate \r\n- Irish utility bill (e.g.: NTL, Chorus, SKY / ESB, Airtricity / Bord Gais / Eircom / Vodafone, O2, Meteor, Three - bill pay phones only).\r\n\r\nIf you are based in Northern Ireland : \r\n- UK driver\'s licence with Northern Ireland address. \r\n- HM Revenue & Customs / Northern Ireland Social Security Agency document showing - National Insurance no. \r\n- Northern Ireland birth certificate \r\n- Northern Ireland marriage certificate\r\n- Northern Ireland utility bill (e.g.: NTL, Chorus, SKY, UTV Internet / NIE, Airtricity / British Gas / BT / Vodafone, O2, 3, T-Mobile, Orange, BT - bill pay phones only).\r\n\r\n\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.12]\r\n'),
(61,'PDN- Must Match Documentation','Thank you for your application. Under the Personal Domain Name category, the proposed domain name must match the name listed in the documentation provided. Please submit revised documentation and we will proceed with registration.'),
(62,'PDN - Fax received, Nickname','Thank you for the fax received. Unfortunately, the format of the proposed domain name is not permitted under the Personal Domain Name category, as abbreviations and nicknames are not acceptable under the Personal Name category unless they explicity appear on the cupporting documentation, therefore we cannot proceed with registration. For information on the correct domain format permitted within this category, please refer to the following url:\r\n\r\nhttp://www.iedr.ie/PDN.php'),
(63,'EuroDNS: Cant verify number - no connection to Ire','Please note that I am unable to verify the number you supplied. Please always make sure to advise us what type of number you are supplying (for example, is this a US/UK company number or a US/UK/EU trademark number) \r\n\r\nFurthermore, unless the company is registered in Ireland or they have an EU trademark, we will require that you submit documentation to show the applicants connection to Ireland.'),
(64,'RBN required - offer conditional acceptance','As the applicant is trading under this name, they are required by law to register the name with the companies registrations office. For further information please see www.cro.ie.\r\n\r\nPlease note that if the applicant is in the process of registering a business name, we would be willing to accept the application on a conditional basis, the condition being the the RBN number is submitted to us withing 8 weeks. If we do not recieve the RBN number within 8 weeks, the domain name will be deleted. This facility is only available to applicants applying under the Registered Business name catetory and the same terms cannot be applied for applicants waiting for Certifcates of Incorporation.'),
(65,'School/Educational Inst','Thank you for your application.  We were unable to verify this School/Educational Institute. Please advise of the schools Roll Number or alternatively submit a letter to us on the headed paper of the school requesting this domain name.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.10]'),
(66,'Overseas Company','Thank you for your application. To proceed with registration, please submit a copy of certificate of incorporation for the applicant.\r\n\r\nPlease also submit information showing the applicant\'s connection to Ireland. \r\n\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n- Copies of invoices (showing trade to or from Ireland).\r\n- High-quality brochures.\r\n- A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n- Community Trade Mark (CTM)'),
(67,'RBN or Discretionary ','If the applicant is trading under this name please supply us with their RBN number, alternatively if this domain name is for a non commercial project please submit information showing the applicants claim to the domain name.'),
(68,'Can\'t verify RBN/CRO','Thank you for your application. Unfortunately, the CRO/RBN number provided could not be verified. Please submit a revised CRO/RBN number and we will proceed with registration.'),
(69,'Require vat no & connection to ireland','Please note that we will require the following to complete this registration:\r\n1) The applicants VAT Number\r\n2) The applicant must demonstrate a connection to Ireland\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n    * Copies of invoices (showing trade to or from Ireland)\r\n    * High-quality brochures\r\n    * A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. '),
(70,'Requires VAT no/Connection to Ireland/Disc Name','Please note that we will require the following to complete this registration:\r\n1) The applicants VAT Number\r\n2) The applicant must demonstrate a connection to Ireland\r\nExamples of acceptable documentation demonstrating substantial trade or commercial activity within Ireland are as follows:\r\n\r\n    * Copies of invoices (showing trade to or from Ireland)\r\n    * High-quality brochures\r\n    * A signed letter on headed paper from a bank manager, firm of chartered accountant(s), registered auditor(s), tax consultant(s) (where the tax advisor identification number is displayed), or solicitor(s) confirming the applicants trade with Ireland. \r\n3) A letter from the applicant outlining their claim to the name, as it is not a relfection of their corporate name'),
(71,'Offer conditional acceptance','Please advise of applicants RBN Number. If you require a conditional acceptance please advise.'),
(72,'Conditional acceptance request','Thank you for your application. To proceed with registration, we will require a copy of the applicant\'s receipt from the company registrations office.'),
(73,'Invalid submission number','The submission number supplied cannot be verified, therefore we will require either a copy of the applicants custoemr receipt for their RBN application or the RBN number to be supplied.'),
