INSERT INTO `_AdminC_Emails_DECOM` VALUES (1,'ADMINC_NICE','From: accountsccp@iedr.ie\r\nTo: $E_Mail\r\nCc: info@$D_Name\r\nCc: webmaster@$D_Name\r\nCc: postmaster@$D_Name\r\nBcc: hostmaster-archive@domainregistry.ie\r\nBcc: accountsccp@domainregistry.ie\r\nSubject: (Notice of Non-Renewal) Re: $D_Name\r\n\r\n  * * This is very important * * Please read it carefully * *\r\n\r\nDear $Admin_Name\r\n\r\nAs administrative contact for the domain name $D_Name, we would like to inform you that your domain name has not yet been renewed.\r\n \r\nIf the domain name is not renewed it will be suspended in 14 days time, whereby access to your website and email services will become unavailable.  After a further 14 days of suspension, the domain will finally be deleted from the .ie database.  (Please Note: Once your domain name has been deleted it will become available to the general public for re-registration on a first come, first served, basis).\r\n\r\nThe current billing contact for your domain name is: $Nic_Name,  $Co_Name\r\n\r\nRenewal Options:\r\n \r\n(1) Contact your current Billing Contact to renew.\r\n \r\n(2) Designate a new Billing Contact for your domain name by choosing either option (a) or (b) listed below: \r\n \r\n(a) Transfer to a new Billing Contact.  To view IEDR accredited resellers please click on the link (www.iedr.ie/resellers).  \r\nOnce you have selected a new Billing Contact please submit a signed fax to IEDR (01 2300365) authorising the transfer of your domain name to [name of new reseller].\r\n \r\nOR\r\n \r\n(b) If you prefer to be billed directly for your domain name: The following is required by the IEDR. Log onto the IEDR website (http://www.iedr.ie/TransferBillingContact.php) and follow the process. You will be required to submit a signed fax to the IEDR (01 2300365) authorising the transfer of your domain name to yourself, and submit a renewal payment for the domain name.\r\n\r\nImportant note: - By changing the billing contact of your domain name your hosting may be affected, contact your hosting provider for further clarification.\r\n \r\n \r\nWhy should you renew your .ie domain?\r\n \r\nLocation - a .ie domain shows you are located or doing business in Ireland.\r\n \r\nIncreased consumer confidence and credibility - Unlike most other top-level domains all .ie domain registrations are screened to ensure the applicant has a claim to the domain and a connection to Ireland. As a result online fraud is less likely to occur on a website using a .ie address.\r\n \r\nGreatly improved listing in search engines - .ie addresses receive higher ratings in search engines, such as Google, than Irish based .com addresses.\r\n \r\nKind Regards,\r\n\r\n.IE Hostmaster\r\n\r\nIE Domain Registry Ltd.\r\nTel: (01) 2365400 ext 295\r\nFax: (01) 2300 365  \r\nEmail: accountsccp@iedr.ie\r\nWeb: http://www.iedr.ie/\r\n\r\n=================================\r\nThe enclosed document is CONFIDENTIAL to the addressee\r\nand IE Domain Registry Ltd. The intended addressee\r\nis NOT AUTHORISED to copy, distribute, disclose or\r\notherwise use the information disclosed.  Please\r\nalso note that this information should not be edited\r\nor redistributed in any way.\r\n====================================\r\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin.\r\nRegistered in Ireland. No: 315315.'),
(2,'ADMINC_ISP','From: accountsccp@iedr.ie\nTo: $E_Mail\nCc: info@$D_Name\nCc: webmaster@$D_Name\nCc: postmaster@$D_Name\nBcc: hostmaster-archive@domainregistry.ie\nBcc: accountsccp@domainregistry.ie\nSubject: (Notice of Non-Renewal) Re: $D_Name\n\n    * * This is very important * * Please read it carefully * *\n\nDear $Admin_Name\n\nAs administrative contact for $D_Name, we would like to inform you that your domain name has not been renewed.\n\n** If you wish to keep $D_Name you should, without delay, contact $Nic_Name - $Co_Name who are currently responsible for managing your domain name. **\n \nIf you do not wish to keep $D_Name you should take no further action. The domain will be suspended in 14 days time. Once suspended you will no longer have access to your website or e-mail services. After 14 days of suspension $D_Name will be deleted from the .ie database, at which stage it will become available to the general public for re-registration on a first come, first served basis.\n\nWhy should you renew $D_Name?\n1. Location on the internet - a .ie domain shows you are located or doing business in Ireland.\n2. Increased consumer confidence and credibility - Unlike most other top-level domains all applications for new .ie domain registrations are screened to ensure the applicant has a claim to the domain and a connection to Ireland. As a result online fraud is less likely to occur on a website using a .ie address.\n3. Greatly improved listing in search engines - .ie addresses receive higher ratings in search engines, such as Google, than Irish based .com addresses.\n4. Security the .ie namespace was recently ranked the second safest in the world.\n\nOther Renewal Options:\n(1) Alternatively, you can choose to transfer billing responsibility for your domain to another IEDR accredited reseller by following the procedures outlined at the following url: \nhttp://www.iedr.ie/TransferBillingContact.php \n\n(2) In the unlikely event that you wish to be billed directly by the IEDR for the annual renewal fee of $D_Name you may transfer billing responsibility by following the procedures outlined at the following url: \nhttp://www.iedr.ie/TransferBillingContact.php \n\nImportant note: - By changing the billing contact of your domain name your hosting may be affected. Contact your hosting provider for further clarification.\n \n \nKind Regards,\n\n.IE Hostmaster\n\nIE Domain Registry Ltd.\nTel: (01) 2365 422\nFax: (01) 2300 365  \nEmail: accountsccp@iedr.ie\nWeb: http://www.iedr.ie/\n\n\n\n\n===========================================\nThe enclosed document is CONFIDENTIAL to the addressee and IE Domain Registry Ltd. The intended addressee is NOT AUTHORISED to copy, distribute, disclose or otherwise use the information disclosed.  Please also note that this information should not be edited or redistributed in any way.\n===========================================\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin.\nRegistered in Ireland. No: 315315.'),
