Ireland. As a result online fraud is less likely to occur on a website using a .ie address.\n3. Greatly improved listing in search engines - .ie addresses receive higher ratings in search engines, such as Google, than Irish based .com addresses.\n4. Security the .ie namespace was recently ranked the second safest in the world.\n\n \nKind Regards,\n\n.IE Hostmaster\n\nIE Domain Registry Ltd.\nTel: (01) 2365 422\nFax: (01) 2300 365  \nEmail: accountsccp@iedr.ie\nWeb: http://www.iedr.ie/\n\n\n\n\n===========================================\nThe enclosed document is CONFIDENTIAL to the addressee and IE Domain Registry Ltd. The intended addressee is NOT AUTHORISED to copy, distribute, disclose or otherwise use the information disclosed.  Please also note that this information should not be edited or redistributed in any way.\n===========================================\nRegistered Office: 14 Windsor Terrace, Sandycove, Co. Dublin.\nRegistered in Ireland. No: 315315.'),
